import React, { Component } from 'react';
import './App.css';

class App extends Component {
  add_numbers_to_selector = (select_id, min_num, max_num) =>{
    var selector = document.getElementById(select_id);
    selector.innerHTML = "";

    for( min_num; min_num<=max_num; min_num++){
      selector.options[selector.options.length] = new Option(min_num);
    }
  }

  create_tables = () =>{
    console.log(document.getElementById("select_1").value);
    console.log(document.getElementById("select_2").value);
  } 

  componentDidMount(){
    this.add_numbers_to_selector("select_1", 1, 5);
    this.add_numbers_to_selector("select_2", 10, 30);
  }

  render(){
    return(
      <div>
        <div id="user_inputs" className="active">
          <h2>Please select number of tables and number of cell in the tables</h2>
          <div>
            <p>Number of tables:</p>
            <select id="select_1"></select>
          </div>

          <div>
            <p>Number of cells:</p>
            <select id="select_2"></select>
          </div>
          <input type="submit" value="Create Tables" onClick={this.create_tables}></input>
        </div>

        <div id="tables" className="passive">
          <div id="table_1">Table 1</div>
          <div id="table_2">Table 2</div>
          <div id="table_3">Table 3</div>
          <div id="table_4">Table 4</div>
          <div id="table_5">Table 5</div>
        </div>
      </div>
    )
  }
}

export default App;
